import React from "react";

import banner0 from '../../Assets/images/banner-4.jpeg'
import banner1 from '../../Assets/images/grocery-banner-2.jpeg'
import banner2 from '../../Assets/images/grocery-banner.png'
import banner3 from '../../Assets/images/slider-2.jpeg'

import Slider from "react-slick";
export default function MainSlider() {
 
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
     return (
    
      <div className="row">
        <Slider {...settings}>
          <img src={banner0} alt="" />
          <img src={banner2} alt="" />
          <img src={banner3} alt="" />

        </Slider>
     
  </div>
  );
}
